import React, { Component } from "react";
import "./register.css";

class Register extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div className="content">
        <h2 style={{ textAlign: "center" }}>Registration Page</h2>
        <input type="text" placeholder="Name" />
      </div>
    );
  }
}

export default Register;
